INSERT INTO `teacher` VALUES (5, '陈静', '26年金融从业经验，拥有CFP、CPB等专业资质。建行家族办公室（北京中心）主管，团队管理资产118亿元。曾多次获得总行私人银行业务多项荣誉和称号，金融理财杂志“金貔貅奖”TOP10，2019年度“中国银行业协会优秀财富顾问”。', 'http://admin-ccb.cczuit.cn/upload/img/20211217103054145.png', 1, '北京市分行家族办公室团队主管', 97, '2021-10-22 21:03:02', '2022-01-10 19:39:41', '');
INSERT INTO `teacher` VALUES (6, '黄光涛', '35年金融从业经验，拥有AFP、CFP、CPB、CRFA、CTP等专业资质。重庆分行私人银行首席高级财富顾问，团队管理资产120亿元。曾荣获全国精英理财师40强,全国十佳明星理财师第一名,中国银行业协会首批“优秀私人财富顾问”，建总行首批“优秀私人财富顾问”，建行大学优秀讲师等行内外荣誉和称号。', 'http://admin-ccb.cczuit.cn/upload/img/20211217103328929.png', 1, '重庆市分行首席私人财富顾问', 96, '2021-10-22 22:08:20', '2022-01-10 19:39:52', '');
INSERT INTO `teacher` VALUES (7, '讲师3', '讲师', 'http://admin-ccb.cczuit.cn/upload/img/20211023092541910.jpg', 0, '软件工程师', 0, '2021-10-23 09:25:44', '2021-10-23 09:25:44', '');
INSERT INTO `teacher` VALUES (8, '万辉斌', '28年银行从业经验，拥有RFP、GIA等专业资质。广东省分行首席财富顾问，管理资产规模超100亿元，曾获中国百佳金融理财师称号。 ', 'http://admin-ccb.cczuit.cn/upload/img/20211130110051383.png', 1, '广东省分行首席财富顾问', 55, '2021-10-24 20:24:21', '2022-01-05 07:34:46', '');
INSERT INTO `teacher` VALUES (9, '讲师3', '讲师3', 'http://admin-ccb.cczuit.cn/upload/img/20211130104030480.jpg', 0, '软件工程师', 0, '2021-10-24 20:25:00', '2021-11-30 10:40:38', '');
INSERT INTO `teacher` VALUES (10, '王虹', '山东省分行私人银行部副总经理、家族办公室（山东中心）负责人。23年银行从业经验，直接管理客户家族资产50亿元，直接服务5个家族办公室家族客户，曾获2019年度“中国银行业协会优秀私人财富顾问”等荣誉。', 'http://admin-ccb.cczuit.cn/upload/img/20211217103228479.png', 1, '山东省分行私人银行部副总经理', 95, '2021-11-12 18:44:55', '2022-01-05 07:32:00', '');
INSERT INTO `teacher` VALUES (11, '方一男', '31年银行从业经验，管理资产规模超百亿。国际公认“反洗钱师（CAMS）”，协助客户签署家族信托或跨境投资超100单。', 'http://admin-ccb.cczuit.cn/upload/img/20211130110033234.png', 1, '浙江省嘉兴市分行私行中心主管', 69, '2021-11-12 18:45:57', '2022-01-05 07:33:58', '');
INSERT INTO `teacher` VALUES (12, '毕文婷', '16年财富管理及私人银行从业经验，CFP持证。上海分行私行财富顾问团队主管，团队管理资产超过470亿元，曾获多项全国赛事奖项，并受邀担任全国金融赛事专家评审和论坛嘉宾。', 'http://admin-ccb.cczuit.cn/upload/img/20211217103119520.png', 1, '上海市分行私行财富顾问团队主管', 99, '2021-11-12 18:46:31', '2022-01-10 19:39:09', '');
INSERT INTO `teacher` VALUES (13, '刘非', '深圳市分行私人银行部副总经理，12年银行从业经验，CFA持证人。曾获建行总行年度最佳财富顾问、2019年福布斯中国优选理财师金奖等荣誉。', 'http://admin-ccb.cczuit.cn/upload/img/20211217103306803.png', 1, '深圳市分行私人银行部首席客户经理', 90, '2021-11-12 18:47:36', '2022-01-05 07:32:22', '');
INSERT INTO `teacher` VALUES (14, '毛宇', '从业二十多年，精研家族服务、慈善、股权投资、风险管理、税收筹划，服务多家上市公司，率先完成国内首单股票家族信托、深圳首单家族产业基金的方案设置及实践。现任建行南山私人银行总经理\r\n总行级财富顾问、培训师，国际金融理财师CFP，私人银行家CPB，新加坡私人银行家证书。', 'http://admin-ccb.cczuit.cn/upload/img/20211217103317628.png', 1, '深圳市分行南山私人银行中心主管', 75, '2021-11-12 18:48:46', '2022-01-05 07:33:14', '');
INSERT INTO `teacher` VALUES (15, '陈晓颖', '建设银行上海市分行私人银行部，财富顾问，拥有10余年高净值客户服务经验。CPA注册会计师、CPB认证私人银行家、国家职业资格二级黄金投资分析师、银行、保险、基金、证券从业等，2019年第二届中国私人银行精英赛金奖，2019年第十届全国杰出财富管理师大赛第四名，2018年首届中国私人银行精英赛银奖，2016年度银行业协会优秀私人财富顾问等', 'http://admin-ccb.cczuit.cn/upload/img/20211130110526415.png', 1, '上海市分行私人银行部财富顾问', 45, '2021-11-12 18:49:16', '2022-01-05 07:35:03', '');
INSERT INTO `teacher` VALUES (16, '方芃芃', '15年银行从业经验，双硕士学位，CPB持证。广东省分行私人银行首席财富顾问，建行家族办公室广东团队牵头人，团队管理资产规模140亿元，曾获首届中国优秀金融理财师称号。 受邀担任2021年第三届中国私人银行精英赛专家评审。', 'http://admin-ccb.cczuit.cn/upload/img/20211130105952717.png', 1, '广东省分行私人银行首席财富顾问', 50, '2021-11-12 18:49:49', '2022-01-05 07:34:32', '');
INSERT INTO `teacher` VALUES (17, '谢池', '11年银行从业经验，清华大学硕士学位，银行、保险、证券从业资质。福建分行私人银行财富顾问，直接管理家族客户超100户，管理家族客户资产近30亿元，曾获建行总行年度优秀财富顾问等荣誉。', 'http://admin-ccb.cczuit.cn/upload/img/20211130110122204.png', 1, '福建省分行私人银行财富顾问', 67, '2021-11-12 18:50:18', '2022-01-10 19:40:53', '');
INSERT INTO `teacher` VALUES (18, '王刚', '11年私人银行财富顾问工作经验，拥有CFP、CPB等专业资质。团队管理资产100亿元，曾获建行总行年度优秀财富顾问等荣誉。', 'http://admin-ccb.cczuit.cn/upload/img/20211112185049138.png', 0, '大连星海湾私行中心主任', 0, '2021-11-12 18:50:50', '2021-11-12 18:50:50', '');
INSERT INTO `teacher` VALUES (19, '郭娜', '17年银行从业经验，12年私人银行从业经验，客户资产规模超百亿。新加坡管理大学财富管理硕士，清华大学工商管理硕士。曾获建行总行优秀财富顾问，北京银行业协会优秀理财师等荣誉。', 'http://admin-ccb.cczuit.cn/upload/img/20211217102647360.png', 1, '北京市分行私行部财富顾问', 98, '2021-12-16 16:49:22', '2022-01-10 19:39:24', '');
INSERT INTO `teacher` VALUES (20, '王刚', '17年银行从业经验，11年私人银行财富顾问工作经验，拥有CFP、CPB等专业资质。现任大连星海湾私行中心主管，团队管理资产100亿元，曾获建行总行年度优秀财富顾问等荣誉。', 'http://admin-ccb.cczuit.cn/upload/img/20211217103109078.png', 1, '大连市分行星海湾私行中心主管', 60, '2021-12-16 16:49:55', '2022-01-05 07:35:29', '');
INSERT INTO `teacher` VALUES (21, '梁凌', '16年银行从业经验，拥有CFP、CPB等专业资质。厦门分行私行财富顾问，团队管理资产300亿元，曾获建行总行年度优秀财富顾问等荣誉。', 'http://admin-ccb.cczuit.cn/upload/img/20211217103207442.png', 1, '厦门市分行私人银行财富顾问', 70, '2021-12-16 16:50:34', '2022-01-05 07:33:25', '');
